import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import axios from 'axios';
import './AdminProfilesPage.css';

const AdminProfilesPage = () => {
  const [profiles, setProfiles] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');

  useEffect(() => {
    fetchProfiles();
  }, []);

  const fetchProfiles = async () => {
    try {
      const response = await axios.get('http://localhost:5000/api/profiles', {
        headers: {
          Authorization: `Bearer ${localStorage.getItem('token')}`
        }
      });
      setProfiles(response.data);
      setLoading(false);
    } catch (error) {
      setError('Ошибка при загрузке анкет');
      setLoading(false);
    }
  };

  const handleStatusChange = async (id, newStatus) => {
    try {
      await axios.patch(`http://localhost:5000/api/profiles/${id}/status`, 
        { status: newStatus },
        {
          headers: {
            Authorization: `Bearer ${localStorage.getItem('token')}`
          }
        }
      );
      fetchProfiles(); // Обновляем список после изменения
    } catch (error) {
      setError('Ошибка при обновлении статуса');
    }
  };

  const handleDelete = async (id) => {
    if (window.confirm('Вы уверены, что хотите удалить эту анкету?')) {
      try {
        await axios.delete(`http://localhost:5000/api/profiles/${id}`, {
          headers: {
            Authorization: `Bearer ${localStorage.getItem('token')}`
          }
        });
        fetchProfiles(); // Обновляем список после удаления
      } catch (error) {
        setError('Ошибка при удалении анкеты');
      }
    }
  };

  if (loading) return <div>Загрузка...</div>;
  if (error) return <div className="error-message">{error}</div>;

  return (
    <div className="admin-profiles-page">
      <div className="admin-header">
        <h1>Управление анкетами</h1>
        <Link to="/admin/create" className="create-button">
          Создать анкету
        </Link>
      </div>

      <div className="profiles-table">
        <table>
          <thead>
            <tr>
              <th>ID</th>
              <th>Имя</th>
              <th>Возраст</th>
              <th>Город</th>
              <th>Статус</th>
              <th>Действия</th>
            </tr>
          </thead>
          <tbody>
            {profiles.map(profile => (
              <tr key={profile._id}>
                <td>{profile._id}</td>
                <td>{profile.name}</td>
                <td>{profile.age}</td>
                <td>{profile.city}</td>
                <td>
                  <select
                    value={profile.status}
                    onChange={(e) => handleStatusChange(profile._id, e.target.value)}
                    className={`status-select status-${profile.status}`}
                  >
                    <option value="active">Активна</option>
                    <option value="pending">На модерации</option>
                    <option value="blocked">Заблокирована</option>
                  </select>
                </td>
                <td className="actions">
                  <Link to={`/admin/edit/${profile._id}`} className="edit-button">
                    Редактировать
                  </Link>
                  <button
                    onClick={() => handleDelete(profile._id)}
                    className="delete-button"
                  >
                    Удалить
                  </button>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
};

export default AdminProfilesPage;
